import Header from "./components/Layout/Header";
import Meals from "./components/Meals/Meals";
import Cart from "./components/Cart/Cart";
import React, {useState} from 'react';

function App() {
	const [isOpen, setIsOpen] = useState(false);
	return (
		<>
			<Cart/>
			<Header/>
			<main>
				<Meals/>
			</main>
		</>
	);
}

export default App;
